      return;  // N·∫øu ƒë·∫ßu v√†o kh√¥ng h·ª£p l·ªá, kh√¥ng chuy·ªÉn h∆∞·ªõng
    }

    // G·ª≠i y√™u c·∫ßu ƒëƒÉng nh·∫≠p t·ªõi backend
    try {
      const response = await axios.post('http://localhost:5001/api/users/login', {
        emailOrPhone: input,  // G·ª≠i th√¥ng tin email ho·∫∑c phone
        password: password,  // M·∫≠t kh·∫©u
      });

      // Ki·ªÉm tra ph·∫£n h·ªìi t·ª´ backend
      if (response.data.success) {
        alert('ƒêƒÉng nh·∫≠p th√†nh c√¥ng!');
        navigate('/');  // Chuy·ªÉn h∆∞·ªõng v·ªÅ trang ch·ªß sau khi ƒëƒÉng nh·∫≠p th√†nh c√¥ng
